commits.sourceNew:
// inherit javadoc
public void extractTerms(Set<Term> terms) {
  for (Iterator iter = termArrays.iterator(); iter.hasNext();) {
    Term[] arr = (Term[])iter.next();
    for (int i=0; i<arr.length; i++) {
      terms.add(arr[i]);
    }
  }
}

